import { I18nextProvider } from "react-i18next";
import { Route, Switch } from 'react-router-dom'
import Home from "pages/Home"
function App() {
  return (
    <Switch>
        <Route exact path="/" components={Home} />
    </Switch>
  );
}

export default App;
